Let $(x,y)$ be a point on the graph of the equation $y = \frac{1}{2} x^2 - 9.$ Then, for any value of $x$, we have that

\begin{align*}

(0-x)^2 + (0-y)^2 &= (x-0)^2 + (y-\frac{1}{2}x^2+9)^2\\

&= x^2+(y-\frac{1}{2}x^2+9)^2

\end{align*}

The smallest value this expression can attain occurs when $x = 0,$ so we have that the distance from the origin to a point on the graph of $y=\frac{1}{2} x^2-9$ is given by \begin{align*}

(0-y)^2

&= y^2\\

&= (\frac{1}{2}(0)^2-9)^2 \\

&=( -9 )^2  =81.

\end{align*}



Therefore, the smallest distance between the origin and a point on the graph of $y=\frac{1}{2} x^2-9$ is given by $\sqrt{81}=9$. We are asked to find $a^2$, where $a$ is this smallest distance.  Therefore, we have that \begin{align*}

a^2&=9^2\\

&=\boxed{81}.

\end{align*}

Since AMC10 and AMC12 are 5-digit numbers, their sum being a 6-digit number implies that we can write the sum as $$10000a+1000b+100c+10d+e+(10000m+1000n+100o+p+q),$$ where $a,d,e,m,n,o,p,q$ are digits. By looking at this, it's clear that the digit in the thousands place of each number is 1, so we can write our sum as \begin{align*} &10000a+1000b+100c+10d+e+10000m+1000n+100o+p+q\\ &= (10000 + 10000)m+(1000+1000)n+(100+100)o +(10+d)+(e+p) \\ &= 20000(m+n)+(1100+100+10)d+e+p . \end{align*} Since the digit in the hundreds place of the sum is $2$, this means that $(1100+100+10)d=2200$. Therefore, we must have $d=2$ (we can check that 1.5 and -3.5 are not both integers). We also know that the sum is a 6-digit number, so $(20000)(m+n)$ must be less than or equal to $100000$, which implies that $10 \leq m+n \leq 99$. Similarly, we can deduce from the digit in the tens place of the sum that $(1100+100)e+(1100+100)p=1200$ and therefore $e+p=1$. Combining these two equations yields a system of four linear equations in three unknowns:

\begin{align*} (1100+100)d&=2200\\ (20000)(m+n)&\leq 100000\\ (1100+100)e+(1100+100)p&=1200\\ e+p &=1 \end{align*}

We can easily solve for $d,e,$ and $p$ in the first three equations:

\begin{align*} d&=2, &e+p&=1 \\ 2200&=2200 & e&=\frac{1200-1100(1)}{100}\\ p &= \frac{1-(e+1) (100)}{100}. \end{align*}

Since $d$ is a digit, the only possible values for $(m,n)$ are $\{10, 11\}, \{9, 12\}$. Substituting these into our equation for $20000(m+n)$ gives

$$110000 \text{ and } 121000.$$

Our original number must be greater than or equal to $100000$ and less than $123422$, so the only possible value is $110000+11111=\boxed{123111}$.

