Since we are given that the average of $a$ and $2b$ is 7, we have that $\frac{a + 2b}{2} = 7$, so $a + 2b = 14$. Similarly, since the average of $a$ and $2c$ is 8, we have that $\frac{a + 2c}{2} = 8$, so $a + 2c = 16$. Subtracting these two equations gives us $2c - 2b = 2$, or equivalently, $c - b = 1$. We can solve for $b$ in terms of $c$: $b = c-1$. If we substitute this into the first equation, we get that $a + (2)(c-1) = 14$. Expanding and rearranging gives us $a=16-c$, so when we average this along with our expression for b in terms of c we can see that \begin{align*}

\frac{a+b+c}{3}&=\frac{(16-c)+(c-1)+c}{3}\\

&=\frac{15+c}{3} 

\end{align*}We are given that the average is $8$, so $\frac{15+c}{3}=8$. Solving for c, we get $c=9$ and then $b = 8$. Substituting these into our equations gives us $a + 2b = a+16=14$ and $a + 2c = a +18 = 16$, so $a= -2$. Therefore the average of integers $a$, $b$, and $c$ is $\frac{8}{3}=\boxed{\frac89}$.
